 const formatDate = (dateField) => {
 const dateValue = display(dateField);
 if (!dateValue) return 'Not available';

 try {
 return new Date(dateValue).toLocaleString('en-US', {
 year: 'numeric',
 month: 'long',
 day: 'numeric',
 hour: '2-digit',
 minute: '2-digit'
 });
 } catch {
 return dateValue;
 }
