 parsing_status: 'completed',
 parsing_confidence: result.confidence || 0,
 is_form_document: result.isForm || false,
 extracted_text: result.text?.substring(0, 8000) || '', // Limit to 8000 chars
 parsed_on: new Date().toISOString(),
 parsing_error: ''
 };

